for the quick sort algorithm? 





public static void quickSort (int a[], int 
lo, int hi){ 
  <statement 1>  
  if (lo >= hi) return; 
  int left = lo;     
  int right = hi;     
  <statement 2> 
  int pivot = a[(lo+hi)/2]; 

  while ( left < right)  {  
    <statement 3>  
    while (a[left] > pivot) left++; 
    <statement 4> 
    while (pivot > a[right]) right--; 
    <statement 5> 
    if (left <= right)    {   
      swap (a, left, right);    
      left++;     
      right--; 
    } 
  } 
  <statement 6> 
  quickSort (a, lo, right); 
  quickSort (a, left, hi); 
} 

public static void swap (int a[],  
                         int i, int j){ 
  int tmp = a[i]; 
  a[i] = a[j]; 
  a[j] = tmp; 
} 

